import React from "react";
import { NavLink } from "react-router-dom";

function Navbar() {
  return (
    <div>
      <nav>
        <div>
          <ul>
            <div>
              <h2>AJIO</h2>
            </div>
            <div>
              <li>Home</li>
              <NavLink to={''}></NavLink>
              <li>Cart</li>
              <li>Wishlist</li>
              <li>Profile</li>
            </div>
          </ul>
        </div>
      </nav>
    </div>
  );
}

export default Navbar;
